// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Auction {
    address payable public auctioneer;
    uint public startTime;
    uint public endTime;
    uint public minIncrement;  // Incremento mínimo del 5%
    uint public gasFeePercent; // Comisión del 2%
    bool public auctionEnded;

    struct Bid {
        address payable bidder;
        uint amount;
    }

    Bid public highestBid;
    mapping(address => uint) public deposits;
    Bid[] public bids;

    // Eventos
    event NewBid(address indexed bidder, uint amount);
    event AuctionExtended(uint newEndTime);
    event AuctionEnded(address winner, uint amount);

    modifier onlyAuctioneer() {
        require(msg.sender == auctioneer, "Only auctioneer can perform this action.");
        _;
    }

    modifier onlyBeforeEnd() {
        require(block.timestamp < endTime, "Auction has already ended.");
        _;
    }

    modifier onlyAfterEnd() {
        require(block.timestamp >= endTime, "Auction is still ongoing.");
        _;
    }

    constructor(uint _auctionDurationMinutes, uint _minIncrement, uint _gasFeePercent) {
        auctioneer = payable(msg.sender);
        startTime = block.timestamp;
        endTime = block.timestamp + (_auctionDurationMinutes * 1 minutes);
        minIncrement = _minIncrement;
        gasFeePercent = _gasFeePercent;
        auctionEnded = false;
    }

    function placeBid() public payable onlyBeforeEnd {
        require(msg.value > 0, "Bid amount must be greater than zero.");
        uint minBidAmount = highestBid.amount + (highestBid.amount * minIncrement) / 100;
        require(msg.value >= minBidAmount, "Bid must be at least 5% higher than the current highest bid.");

        // Almacenar oferta anterior para el posible reembolso
        if (highestBid.bidder != address(0)) {
            deposits[highestBid.bidder] += highestBid.amount;
        }

        highestBid = Bid(payable(msg.sender), msg.value);
        bids.push(highestBid);

        // Extender subasta si está dentro de los últimos 10 minutos del tiempo original
        if (block.timestamp >= endTime - 10 minutes) {
            endTime += 10 minutes;
            emit AuctionExtended(endTime);
        }

        emit NewBid(msg.sender, msg.value);
    }

    function getWinner() public view onlyAfterEnd returns (address, uint) {
        require(auctionEnded, "Auction must be ended to get the winner.");
        return (highestBid.bidder, highestBid.amount);
    }

    function getBids() public view returns (Bid[] memory) {
        return bids;
    }

    function finalizeAuction() public onlyAuctioneer onlyAfterEnd {
        require(!auctionEnded, "Auction has already been finalized.");
        auctionEnded = true;

        uint gasFee = (highestBid.amount * gasFeePercent) / 100;
        auctioneer.transfer(highestBid.amount - gasFee);

        emit AuctionEnded(highestBid.bidder, highestBid.amount);
    }

    function withdrawPartialDeposit() public onlyBeforeEnd {
        uint refundableAmount = deposits[msg.sender];
        require(refundableAmount > 0, "No funds available for refund.");

        deposits[msg.sender] = 0;
        payable(msg.sender).transfer(refundableAmount);
    }

    function refundLosingBids() public onlyAfterEnd {
        require(auctionEnded, "Auction has not ended yet.");
        uint refundAmount = deposits[msg.sender];
        require(refundAmount > 0, "No refund available.");

        uint gasFee = (refundAmount * gasFeePercent) / 100;
        uint refundWithFee = refundAmount - gasFee;

        deposits[msg.sender] = 0;
        payable(msg.sender).transfer(refundWithFee);
    }
}

